     htmlstr+='<pre>&lt;tr&gt;';
     htmlstr += '&lt;td&gt;'+(i+1).toString()+'&lt;/td&gt;';
     htmlstr += '&lt;td&gt;'+table.rows[i+1].cells[1].innerHTML+'&lt;/td&gt;';
